import React from 'react';
import './style.css';

export default function Profile(){
    return (
        <div id="profile-container">
            <h1>Cadastro</h1>
            <form>
                <strong>Nome:</strong>
                <input name="name"/>
                <strong>Email:</strong>
                <input  type="email" email="email"/>
                <strong>Idade:</strong>
                <input idade="idade"/>
                <strong>Empresa:</strong>
                <input empresa="empresa"/>
                <button className="button" type="submit">Salvar</button>
            </form>
        </div>
    );
}
